import React from 'react'

const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }


  const Header = (props) => {
    return (
      <div>
        <h1>{props.course}</h1>
      </div>
    )
  }

  const Content = () => {
    return (
      <div>
        <p>{course.name} {course.exercises}</p>
        <p>{course.name} {course.exercises}</p>
        <p>{course.name} {course.exercises}</p>
      </div>
    )
  }

  const Total = () => {
    return (
        <p>Number of exercises</p>
    )
  }

  return (
    <div>
      <Header course={course} />
      <Content parts={course} />
      <Total parts={course} />
    </div>
  )
}

export default App
